import syled from "styled-components";
import Announcement from "../components/Annoucement";
import Footer from "../components/Footer";
import Navbar from "../components/Navbar";
import Newsletter from "../components/Newsletter";

const Container = syled.div``;
const Wrapper = syled.div`
    padding: 50px;
    display: flex;
`;
const ImgContainer = syled.div`
    flex: 1;

`;
const Image = syled.img`:
    width: 100%;
    height: 90vh;
    object-fit: cover;
`;
const InfoContainer = syled.div`
    flex: 1;
    padding: 0px 50px;
`;
const Title = syled.h1`
    font-weight: 200;
`;
const Desc = syled.p`

    margin:20px 0px;
`;
const Price = syled.span`

    font-weight: 100;
    font-size: 48px;
`;
const Product = () => {
  return (
    <Container>
      <Navbar />
      <Announcement />
      <Wrapper>
        <ImgContainer>
          <Image src="https://ik.imagekit.io/anik/clothes/640123d55b1f7524ca7c11ee7c74c6dc_7zIMq2jHj.png?ik-sdk-version=javascript-1.4.3&updatedAt=1649584323279" />
        </ImgContainer>
        <InfoContainer>
          <Title>Gangsta T-Shirt</Title>
          <Desc>
            Own your Hood with this Gangsta T-Shirt, Your homies will run to
            you, asking where you brought it, Go and reclaim the hood
          </Desc>
          <Price>$20</Price>
          <FilterContainer>
            <Filter>
              <FilterTitle>Color</FilterTitle>
              <FilterColor color="black" />
              <FilterColor color="black" />
              <FilterColor color="black" />
            </Filter>
          </FilterContainer>
        </InfoContainer>
      </Wrapper>
      <Newsletter />
      <Footer />
    </Container>
  );
};

export default Product;
